import axios from 'axios';
import React, {Fragment, useState, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux'
import {withRouter} from "react-router-dom";
import Crypt from '../../utilities/crypt';

const Chat = (props) => {

    const t = useSelector(state => state.translations.translations);
    const [updated, setUpdated] = useState(false);
    const dispatch = useDispatch();
    const [walletState, setWalletState] = useState({address: "", balance: 0});


    useEffect(() => {

        if(!updated){
            updateWallet();
            setUpdated(true)
        }

    }, [walletState]);

    const updateWallet = () => {
        axios.get('http://localhost:7020/api/v1/wallet')
        .then(results => {
            console.log(results)
            setWalletState(results.data)
        })
        .catch(err => {
            console.log(err)
        });
    }

    const UI = () => {
        return (
            <Fragment>
                <h1>CHAT</h1>
                <p>Balance: {walletState.balance}</p>

                <p>Address: {walletState.address}</p>
            </Fragment>
        )
    }

    return (
        <Fragment>
            {UI()}
        </Fragment>
    )

}

export default withRouter(Chat)
